import React from "react";

function CheckBox(){
    return(
        <div className="checkBox">
            <input type="checkbox" /><span>Code for 12 hrs<br/></span>
            <input type="checkbox" /><span>Exercise 1 hr<br/></span>
            <input type="checkbox" /><span>Cook<br/></span>
            <input type="checkbox" /><span>Sleep<br/></span>

        </div>
    )
}
export default CheckBox;
